long_desc.thetext:
As-is

First I want to describe my current tools for the "website" usecase. The base library is jQuery. Personally I like small footprints and tools that closely fit requirements so I have jQuery 1.2.6 which is 30KiB minified. It's old but it does essential functions well in cross-browser manner: selectors, traversal facilities, DOM manipulations, XHR. In addition it has some form handies, browser detection and some other minor things. I update it only when it's another library's requirement, e.g. jQueryUI.

Another important thing is cross-browser (IE's fault actually, others are fine) JavaScript 1.6 Array functionality. Critical methods are forEach, filter, map, indexOf. So I've JavaScript file which acts like qx.lang.Core.

Code organisation. When webpage has some logic beyond decoration plugin invocation, even in a simple case plain everything-in-dom-ready-function never feels good, certainly in sense of maintainability. So for simple cases I use plain map which acts as some sort of singleton. In more complex cases I use Dean Edwards Base.js (http://dean.edwards.name/weblog/2006/03/base/) which gives basic class inheritance.

Putting these together I have a minimal required set of tools which gives me ability to create and maintain website/webpage logic (as an sample of what such approach could result in, my greasemonkey script http://userscripts.org/scripts/review/98307). But I've never felt enough comfortable about this approach. It has certain issues, e.g. jQuery event handlers, traversing handlers, etc. operate in context of DOM node so for structured code it eventually ends up in context juggling (which strongly requires Function.prototype.bind to deal with). Even though this approach works it frequently reminds me of "The Best Is The Enemy Of The Good".

Keeping in mind that by far qooxdoo is one most robust, stable and well-designed software I've dealt with the idea of having same quality library for the "website" usecase is very tempting! Here I mean essentials all-in-one (possible issues of what to consider essential) library providing JavaScript 1.6 compatibility, selectors (think Sizzle), DOM manipulations, class-based inheritance, events, templating (Mustache turned out to be pretty usable), network facilities, and last but not least extensibility (thing 3rd party plugins).


To-be

Since recently I had some spare time I've started looking into qx.Website. First I've reviewed the code of qx.Website API viewer which is I guess by now the biggest application written with qx.Website. A boilerplate/missing functionality:

* String formatting.

  q.create("<h1>" + name + "</h1><p style='color: #C00F00'><em>Failed to load " + name + " documentation!</em></p>")
  list.append(q.create("<a href='#" + name + "'><h1>" + name + "</h1></a>"));
  module.append(q.create("<h1 id='" + name + "'>" + name + "</h1>"));

Looks quite messy. qx.Website doesn't include qx.lang.Object.format in any kind. qx.lang.Object.format implementation itself leaves questions, it's neither C-like printf nor Python 2.6+ str.format. It's something in between, but anyway it's better than nothing. Even considering included Mustache, string formatting is still an essential feature in my opinion.

I guess the qooxdoo's policy of modification of base prototypes permits only compatibility workaround, so it's unlikely that format could be added to String.prototype. At least until this policy is revised. Personally I use and find very practical Python's str.format simplest subset:

  String.prototype.format = function format(args)
  {
    var value = this;
    for(var i = 0; i < arguments.length; i++)
    {
      value = value.replace('{' + i + '}', arguments[i]);
    }

    return value;
  };

* Xhr.

  q.io.xhr("script/q.json").send().on("loadend", function(xhr) {
    if (xhr.readyState == 4 && xhr.status >= 200 && xhr.status < 400) {
      // ...
    } else {
      // ...
    }
  });

That's awful as a user code. Is it really the recommended way of using q.io.xhr? Why not "load" event?

* Show/hide. 

  q("#warning").setStyle("display", "none");
  q(".plugin").setStyle("display", hide ? "block" : "none");

It's not a problem albeit uncommon to see this in user code. I think show/hide shortcuts are quite common, also considering qx.ui.core.Widget has ones.

Also API viewer application doesn't propose any class based code organisation. I understand it's the very begging of the library, but it would be nice to see some example of proposed design. At the moment I've written this I stopped. Then read last qooxdoo news and duh! The rewritten ToDo app in class-manner :-) Well, it looks pretty clear except that hack-looking object instantiation and undocumented q.define argument omission.


Issues

* Base type prototype modification policy. It's hard to comprehend now what is this policy about. There're qx.lang.Core and qx.module.Polyfill. Earlier I thought that qx.lang.Core restores (newly coined "polyfills" word?) JavaScript 1.6 comaptibility (Array.*). But it has String.quote which is non-standard considering MDN. On the other hand qx.module.Polyfill has standard String.trim (1.8) and non-standard Function.bind. Looks not quite straightforward. Also qx.lang.Core is applied in both "desktop"and "website", where qx.module.Polyfill only in "website". 

If policy isn't strict it would be nice to add String.format in some (conventional) kind.

* Custom builds e.g. exclude some modules, add own. What is the recommended way? Redefining Q_INCLUDES and write own modules attaching to q?

* As the time goes by, more interesting modules, like recent storage module, could be added to the q. So it will affect the footprint and part loading will be a solution. Is partial build supported for "website"? I've seen loader files for "website" in /tool but haven't seen part loader API.

* More serious is the problem of, say, productivity. If today I switch from jQuery to qx.Website I will loose all that hundreds useful plugins out there on the web (popups, image viewers, tabs, scrollers, hints, etc). Ability to quickly find such plugin in short time results in very productive client-side development. I have no illusion about it with qx.Website. Unlikely there will be any comparable amount of them for qx.Website in short time. And it would be quite inefficient to implement such plugin from scratch, also considering that many projects have graphic designer dedicated to client side, who usually has very limited programming capabilities. 

But nothing is actually that bad. If selector engine is the same, and DOM manipulations are pretty much the same, so it could worth to try to implement some jQuery compatibility layer (define jQuery, map methods) with basic functionality which could be enough for some plugins. It would solve the most of the problem. I'll dig further that way.


That's it for now. I'll try to writing something close to real world with it in next significant spare time slice. As I've already told the idea is promising :-)
